import { Link } from "react-router-dom";

export default function ContactConfirm() {
  return (
    <div>
      <h2>
        Thank you for reaching out. A member of our team will reach out to you
        soon.
      </h2>

      <Link to={"/"}>Go back to home</Link>
    </div>
  );
}
